import React from 'react';
import { BrowserRouter ,Switch, Route} from 'react-dom';
import Home from "."

const Routes = () => {
    return (
        <BrowserRouter>
            <switch>
                <Route exact path = "/" component={Home} />     
            </switch>
        </BrowserRouter>
    )
}

export default Routes;
